const BlockFilm = () => {

    let arr = [
        {title: 1, text: 'one', id: 1 },
        {title: 2, text: 'two', id: 2 },
        {title: 3, text: 'tree', id: 3 },
    ]


    let newArr = arr.map((item) => {
        <div className="card">
            <div className="card-header" key={item.id +1}>
               {item.title}
            </div>
            <div className="card-body">
                <h5 className="card-title">fdsf</h5>
                <p className="card-text">С вспомогательным текстом ниже в качестве естественного перехода к дополнительному контенту.</p>
                <a href="#" className="btn btn-primary">Перейти куда-нибудь</a>
            </div>
        </div>
    })

return(
    {newArr}
)

}

export default BlockFilm;
